import React, { useState } from "react";
import { Button, Form, Container, Row, Col, Card } from "react-bootstrap";
import "./TradeForm.css"; // ייבוא קובץ CSS מותאם אישית

const TradeForm = () => {
  const [action, setAction] = useState("buy");
  const [symbol, setSymbol] = useState("");
  const [quantity, setQuantity] = useState("");
  const [price, setPrice] = useState("");
  const [date, setDate] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(
      `Action: ${action}\nSymbol: ${symbol}\nQuantity: ${quantity}\nPrice: ${price}\nDate: ${date}`
    );
  };

  return (
    <Container className="my-4">
      <Row>
        <Col lg={6} md={8} sm={12} className="mx-auto">
          <Card
            className={`trade-form-card ${
              action === "buy" ? "buy-bg" : "sell-bg"
            }`}
          >
            <Card.Body>
              <h2 className="text-center">
                {action === "buy" ? "Buy Stock" : "Sell Stock"}
              </h2>
              <Form onSubmit={handleSubmit}>
                <Form.Group className="mb-3" controlId="formSymbol">
                  <Form.Label>Symbol</Form.Label>
                  <Form.Control
                    type="text"
                    placeholder="Enter stock symbol"
                    value={symbol}
                    onChange={(e) => setSymbol(e.target.value)}
                    className="trade-form-input"
                  />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formQuantity">
                  <Form.Label>Quantity</Form.Label>
                  <Form.Control
                    type="number"
                    placeholder="Enter quantity"
                    value={quantity}
                    onChange={(e) => setQuantity(e.target.value)}
                    className="trade-form-input"
                  />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formPrice">
                  <Form.Label>Price</Form.Label>
                  <Form.Control
                    type="number"
                    step="0.01"
                    placeholder="Enter price"
                    value={price}
                    onChange={(e) => setPrice(e.target.value)}
                    className="trade-form-input"
                  />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formDate">
                  <Form.Label>Date</Form.Label>
                  <Form.Control
                    type="date"
                    placeholder="Enter date"
                    value={date}
                    onChange={(e) => setDate(e.target.value)}
                    className="trade-form-input"
                  />
                </Form.Group>
                <Button
                  variant={action === "buy" ? "success" : "danger"}
                  type="submit"
                  className="w-100 trade-form-btn"
                >
                  {action === "buy" ? "Buy" : "Sell"}
                </Button>
              </Form>
            </Card.Body>
          </Card>
        </Col>
      </Row>
      <Row>
        <Col className="text-center">
          <Button
            variant="success"
            onClick={() => setAction("buy")}
            className="me-2 trade-form-switch-btn"
          >
            Buy
          </Button>
          <Button
            variant="danger"
            onClick={() => setAction("sell")}
            className="trade-form-switch-btn"
          >
            Sell
          </Button>
        </Col>
      </Row>
    </Container>
  );
};

export default TradeForm;
